import React from 'react'

const Item = (props) => {
    return (
        <div>
            <span>{props.brand}</span>
            <span>{props.title}</span>
            <span>{props.price}</span>
            <img src={require("../media/")} alt="image" />
        </div>
    )
}

export default Item
